                Console.WriteLine($"Friend {j} Unknown string {br.ReadInt32()}");
                Console.WriteLine($"Friend {j} Unknown int {br.ReadInt32()}");
                bool clan = br.ReadBoolean();
                Console.WriteLine($"Friend {i} Has clan {clan}");
                if (clan)
                {
                    Console.WriteLine($"Friend {j} Clan ID {br.ReadInt64()}");
